import React, { useState } from "react";
import {
  Box,
  Button,
  Typography,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  IconButton,
  TextField,
} from "@mui/material";
import { Edit } from "@mui/icons-material";
import { useNavigate } from "react-router-dom";
import * as XLSX from "xlsx";

interface Transaction {
  id: number;
  coin: string;
  type: string;
  price: number;
  amount: number;
  total: number;
  fee: number;
  profit: number | null;
}

const UploadTransactions: React.FC = () => {
  const [transactions, setTransactions] = useState<Transaction[]>([]);
  const [selectedTransaction, setSelectedTransaction] = useState<number | null>(null);
  const [buyPrice, setBuyPrice] = useState<number | null>(null);
  const navigate = useNavigate();

  const handleFileUpload = (e: React.ChangeEvent<HTMLInputElement>, type: "spot" | "futures") => {
    const file = e.target.files?.[0];
    if (!file) return;

    const reader = new FileReader();
    reader.onload = (event) => {
      const binaryStr = event.target?.result;
      const workbook = XLSX.read(binaryStr, { type: "binary" });
      const sheetName = workbook.SheetNames[0];
      const sheetData = XLSX.utils.sheet_to_json(workbook.Sheets[sheetName]);

      if (type === "spot") {
        const parsedTransactions: Transaction[] = (sheetData as any[]).map((row, index) => ({
          id: index + 1,
          coin: row["Market"] || `Coin ${index + 1}`,
          type: row["type"],
          price: parseFloat(row["Price"]),
          amount: parseFloat(row["Amount"]),
          total: parseFloat(row["Total"]),
          fee: parseFloat(row["Fee"]),
          profit: null,
        }));

        setTransactions(parsedTransactions);
      } else {
        alert("Futures file processing is not implemented yet.");
      }
    };
    reader.readAsBinaryString(file);
  };

  const calculateProfit = () => {
    const updatedTransactions = transactions.map((txn) => {
      if (txn.type.toLowerCase() === "sell") {
        const correspondingBuyTxn = transactions.find(
          (t) => t.coin === txn.coin && t.type.toLowerCase() === "buy"
        );

        if (correspondingBuyTxn) {
          return {
            ...txn,
            profit: txn.total - correspondingBuyTxn.total - txn.fee,
          };
        }

        if (buyPrice !== null) {
          return {
            ...txn,
            profit: txn.total - buyPrice - txn.fee,
          };
        }
      }
      return txn;
    });

    setTransactions(updatedTransactions);
  };

  const editTransaction = (id: number) => {
    setSelectedTransaction(id);
  };

  const updateTransaction = () => {
    if (selectedTransaction !== null && buyPrice !== null) {
      const updatedTransactions = transactions.map((txn) =>
        txn.id === selectedTransaction
          ? { ...txn, profit: txn.total - buyPrice - txn.fee }
          : txn
      );
      setTransactions(updatedTransactions);
      setSelectedTransaction(null);
      setBuyPrice(null);
    }
  };

  const calculateTax = () => {
    const totalProfit = transactions.reduce((sum, txn) => sum + (txn.profit || 0), 0);
    const taxLiability = totalProfit * 0.3; // 30% flat tax
    alert(`Total Tax Payable: â‚¹${taxLiability.toFixed(2)}`);
  };

  return (
    <Box sx={{ padding: 3 }}>
      <Button
        variant="outlined"
        color="secondary"
        onClick={() => navigate("/")}
        sx={{ mb: 2 }}
      >
        Back
      </Button>
      <Typography variant="h5" gutterBottom>
        Upload Transactions
      </Typography>
      <Box sx={{ mb: 2 }}>
        <Button
          variant="contained"
          component="label"
          color="primary"
          sx={{ mr: 2 }}
        >
          Upload Spot Transaction File
          <input
            type="file"
            hidden
            accept=".xlsx, .xls"
            onChange={(e) => handleFileUpload(e, "spot")}
          />
        </Button>
        <Button
          variant="contained"
          component="label"
          color="primary"
        >
          Upload Futures Transaction File
          <input
            type="file"
            hidden
            accept=".xlsx, .xls"
            onChange={(e) => handleFileUpload(e, "futures")}
          />
        </Button>
      </Box>

      {transactions.length > 0 && (
        <>
          <TableContainer component={Paper} sx={{ mt: 3 }}>
            <Table>
              <TableHead>
                <TableRow>
                  <TableCell>ID</TableCell>
                  <TableCell>Coin</TableCell>
                  <TableCell>Type</TableCell>
                  <TableCell>Price</TableCell>
                  <TableCell>Amount</TableCell>
                  <TableCell>Total</TableCell>
                  <TableCell>Fee</TableCell>
                  <TableCell>Profit</TableCell>
                  <TableCell>Actions</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {transactions.map((txn) => (
                  <TableRow key={txn.id}>
                    <TableCell>{txn.id}</TableCell>
                    <TableCell>{txn.coin}</TableCell>
                    <TableCell>{txn.type}</TableCell>
                    <TableCell>{txn.price}</TableCell>
                    <TableCell>{txn.amount}</TableCell>
                    <TableCell>{txn.total}</TableCell>
                    <TableCell>{txn.fee}</TableCell>
                    <TableCell>{txn.profit !== null ? txn.profit.toFixed(2) : "N/A"}</TableCell>
                    <TableCell>
                      <IconButton onClick={() => editTransaction(txn.id)} color="primary">
                        <Edit />
                      </IconButton>
                    </TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>

          {selectedTransaction !== null && (
            <Box sx={{ mt: 3 }}>
              <TextField
                label="Buy Price"
                type="number"
                fullWidth
                value={buyPrice || ""}
                onChange={(e) => setBuyPrice(Number(e.target.value))}
                sx={{ mb: 2 }}
              />
              <Button variant="contained" onClick={updateTransaction}>
                Update Transaction
              </Button>
            </Box>
          )}

          <Button
            variant="contained"
            color="primary"
            onClick={calculateProfit}
            sx={{ mt: 3, mr: 2 }}
          >
            Calculate Profit
          </Button>
          <Button
            variant="contained"
            color="secondary"
            onClick={calculateTax}
            sx={{ mt: 3 }}
          >
            Calculate Tax
          </Button>
        </>
      )}
    </Box>
  );
};

export default UploadTransactions;
